import React from "react";

const Navbar = () => {
    return(
        <div className="navbar">
            <span className="navbar-logo">Chatrooms</span>
            <div className="navbar-user">
                <img src="" alt="" className="navbar-user-img"/>
                <span>Richard</span>
                <button>logout</button>
            </div>
        </div>
    )
}

export default Navbar;
